import Rebase from "re-base";
import firebase from "firebase";

const firebaseApp = firebase.initializeApp({
  apiKey: "AIzaSyCyxTnhRgjfRG4jOnHKiUv_v9BHtTS3wd4",
  authDomain: "catch-of-the-day-ec.firebaseapp.com",
  databaseURL: "https://catch-of-the-day-ec.firebaseio.com"
});

const base = Rebase.createClass(firebaseApp.database());
export { firebaseApp };
export default base;
